    true,nt"url": null,nt"notes": "<p>Before the Affordable Care Act, Americans
    with pre-existing conditions who did not receive health coverage through their employers
    had few affordable options to get the care they needed. In most States, insurance
    companies could refuse to sell them coverage, charge exorbitant premiums, or offer
    them coverage that excluded benefits for their health conditions. The result has
    been tens of thousands of Americans with serious health conditions like cancer and
    heart disease who have been unable to afford health insurance or to pay out of pocket
    for their own medical care.</p>n",nt"license_title": "Other License Specified",nt"extras":
